Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read
      .textFile("path/to/onsite/data")
      .javaRDD

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read
      .textFile("path/to/top/queries")
      .javaRDD

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache = mutable.Map[String, (Long, Long)]()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val cachePart = mutable.Map[String, (Long, Long)]()
      val hitMiss = ListBuffer[(String, Boolean)]()

      while (iter.hasNext) {
        val line = iter.next()
        val Array(query, timestamp) = line.split("\\s+")

        if (broadcastTopQueries.value.contains(query)) {
          val cacheEntry = cachePart.getOrElseUpdate(query, (timestamp.toLong, 0L))
          val (lastAccess, missCount) = cacheEntry

          if (timestamp.toLong - lastAccess > 12 * 60 * 60 * 1000) { // 12 hours in milliseconds
            cachePart.update(query, (timestamp.toLong, missCount + 1))
            hitMiss.append((query, false))
          } else {
            hitMiss.append((query, true))
          }
        }
      }

      // Merge cache partitions
      cache.synchronized {
        cachePart.foreach { case (query, (lastAccess, missCount)) =>
          val cacheEntry = cache.getOrElseUpdate(query, (lastAccess, missCount))
          val (_, cacheMissCount) = cacheEntry
          cache.update(query, (lastAccess, cacheMissCount + missCount))
        }
      }

      hitMiss.toIterator
    }).countByValue()

    // Calculate hit rate
    val totalQueries = hitRate.values.sum
    val hitCount = hitRate.getOrElse("(true,1)", 0L)
    val missCount = hitRate.getOrElse("(false,1)", 0L)
    val hitRateValue = hitCount.toDouble / (hitCount + missCount)

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job reads the onsite attributed data and top frequent queries from text files, broadcasts the top queries to all nodes, initializes a cache to store the last access time and miss count for each query, and processes the onsite data in parallel. For each query in the onsite data, it checks if it is in the top queries and if it is in the cache. If it is not in the cache or the last access time is more than 12 hours ago, it increments the miss count and marks it as a miss. Otherwise, it marks it as a hit. The job then calculates the hit rate by dividing the number of hits by the total number of queries.

